import './Home.css';
import Navbar from './Navbar';

const navigation = [
  {
    "nom" : "Accueil",
    "lien" : "/test"
  },
  {
    "nom" : "About",
    "lien" : "/about"
  },

]

function Home(props) {
  return (
    <div>
      <Navbar info={ navigation } />
      <h1 className='text-3xl font-light'>Home</h1>
    </div>
  );
}

export default Home;
